import React from "react";
import { withGoogleSheets } from "react-db-google-sheets";

const SingleSheet = (props) => (
  <div>
    {props.db.sheet1.map((data) => (
      <span>{data.id}</span>
    ))}
  </div>
);
export default withGoogleSheets()(SingleSheet);
